import { createSlice } from "@reduxjs/toolkit"

const dataPizzaSlice = createSlice({
    name: "posts",
    initialState: {},
    reducers: {
        getData: (state) =>
        {
            return state
        }
    }
})

export const { getData } = dataPizzaSlice.actions
export const selectData = (state.posts.value)
export default dataPizzaSlice.reducers
